import React from 'react'

export default function api() {
  function getData() {
    fetch('../../../backend/backend.json')
      .then((res) => {
        return res.json();
      })
      .then((json) => {
        console.log(json);
      });
  }
  return (
    <div>
      {getData()}
    </div>
    )
}
